import React from "react";
import { Data } from "./Data";
import { DishCard } from "./DishCard";
const Dish = () => {
  return (
    <>
      <div className="container">
        <div className="row p-3">
          <div className="col-10 col-md-10 mx-auto mt-5 bg-info">
            <div className="row">
              {Data.map((val, indx) => {
                const { image, name, category, price, recipe } = val;
                return (
                  <DishCard
                    key={indx}
                    image={image}
                    name={name}
                    category={category}
                    price={price}
                    recipe={recipe}
                  />
                );
              })}
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Dish;
